                            </CardBody>
                        </Card>
                    </Col>
                    <Col sm="12" md="3" lg="3" xl="3">
                        <Card className='shadow'>
                            <CardBody>

                            </CardBody>
                        </Card>
                    </Col>
                </Row>
            </Container>
        </Fragment>
    );
}

export default ViewIndividualTutorialVideoHelper;
